- input: "TEXT\x1CC00006486\x1CSA11AI.97131.TEXT\x1CSA11AI.97131\x1CSA11AI\x1COn 1/7/09
    we received a contribution from Bruce Bodner in the amount of $25,000, which was
    deposited into our federal account.  Fifteen thousand dollars was transferred
    to our non-federal account, which can accept unlimited contributions from individuals,
    on 1/7/09.  A letter was sent to Mr. Bodner explaining how his contribution was
    split into our accounts and to offer him a chance for a refund.  According to
    AO 2001-17, the Committee has deemed it sufficient to deposit checks exceeding
    the donor's federal limit into our federal account and then to make a transfer
    to the non-federal account for the portion that exceeds the federal limit."
